import { useAppTheme } from '../../../context/ThemeAppContext';
import { Container } from './Navbar.styles';

export function Navbar() {
  const { toggleTheme } = useAppTheme();

  return <Container>
    <button onClick={() => toggleTheme()}>Toggle Theme</button>
  </Container>;
}
